<!doctype html>
<html>
  <head>
    <meta http-equiv='content-type' content='text/html;charset=UTF-8'/>
    <title>Clojure animated test page</title>
    <style>
      body {
        font-family: "Helvetica Neue", Helvetica, Arial, sans-serif;
        width: 960px;
        height: 500px;
        position: relative;
      }

      form {
        position: absolute;
        top: 1em;
        left: 1em;
      }

      path {
        fill-rule: evenodd;
        stroke: #333;
        stroke-width: 2px;
      }

      .sun path {
        fill: cornflowerblue;
      }

      .planet path {
        fill: yellowgreen;
      }

      .annulus path {
        fill: darkorange;
      }
    </style>
  </head>
  <body>
    <div id="app"></div>
    <script type='text/javascript'>
    if(typeof Math.imul == "undefined" || (Math.imul(0xffffffff,5) == 0)) {
    Math.imul = function (a, b) {
        var ah  = (a >>> 16) & 0xffff;
        var al = a & 0xffff;
        var bh  = (b >>> 16) & 0xffff;
        var bl = b & 0xffff;
        // the shift by 0 fixes the sign on the high part
        // the final |0 converts the unsigned value into a signed value
        return ((al * bl) + (((ah * bl + al * bh) << 16) >>> 0)|0);
    }
}
